  [],\n\t\"title\": \"5 meter ArcRaster grid of multibeam bathymetry of the offshore
  area of Cape Ann - Salisbury Beach Massachusetts Survey Area (BATH_OS5m, UTM Zone
  19, WGS84)\",\n\t\"tracking_summary\": {\n\t\t\"total\": 10,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2015-12-09T02:45:32.924947\",\n\t\"name\":
